import React from "react";
import { Link } from "react-router-dom";
import Movies from "../components/Movies"
const Listmov = ({ props }) => {
    if(!props){
        return(
            <h1 className="">NO SE ENCONTRARON RESULTADOS</h1>
        )
    }

  return (
    <div >
      {props.map((movies, i) => {
        return (
          <div key={i}>
            <Link to={`/movies/${movies.imdbID}`}>
                <Movies props={movies}/>
            </Link>
          </div>
        );
      })}
    </div>
  );
};

export default Listmov;
